Actionscript.script:
stop();
_root.warpframe = false;
onEnterFrame = function () {
	if (this.warp1.hitTest(_root.Course.Char.charClip.feet) && _root.Course.Char.yspeed>0) {
		_root.Course.Char.attack = true;
		_root.Course.Char.xspeed = 0;
		_root.Course.Char.yspeed = 0;
		_root.Course.Char.attackFrame = "none";
		warp = true;
		warpnum = 1;
	}
	if (warp == true && _root.warpframe == false) {
		if (warpnum == 1) {
			_root.attachMovie("downtransition", "downtransition"+_root.getNextHighestDepth(), _root.getNextHighestDepth(), {_x:_root.screensizeX/2, _y:_root.screensizeY/2});
		}
		warp = false;
	}
	if (_root.warpframe == true) {
		if (warpnum == 1) {
			_root.changecourse("downtransition2", "8-10", 500, -1450, 500, -1450);
		}
		//_root.warpframe = false;                      
	}
};

onClipEvent (load) {
	frame = 19;
	deepness = 100;
	fallspeed1 = 0.2;
	fallspeed2 = 0.8;
	sinktime = 50;
}

onClipEvent (load) {
	restart = true;
	scale = 2;
	Direction = -1;
	//Message = "Heh, you fell into my trap. If you want to get this Shine Sprite you will have to throw me off of this platform.";
}
onClipEvent (enterFrame) {
	bounceto = _root.Course.Char._x-_root.Course.BackGFX._x;
}

